g2:c.PROCEDURE.g2:a.TEXT:
get-class-hierarchy-and-compare-to-what-expected-test (node: class benchmark-node)

CH: structure;

expected-text : text;

actual-result : structure;
actual-text : text;

comparison-result : integer;

len : integer;

begin

expected-text = "structure(ITEM-OR-NAME:@"ITEM@",CHILDREN:sequence(structure(ITEM-OR-NAME:@"OBJECT@",CHILDREN:sequence(structure(ITEM-OR-NAME:TEST-PARENT-CLASS,CHILDREN:sequence(structure(ITEM-OR-NAME:TEST-CHILD-CLASS)))))))";

actual-result = call g2-get-class-hierarchy (the symbol test-parent-class);
actual-text = "[actual-result]";

len = length-of-text(actual-text);

actual-text = find-and-replace-pattern ("<whitespace>","",actual-text,1,len);

comparison-result = compare-text (expected-text, actual-text);

post "[comparison-result]";

post "[expected-text]";
post "[actual-text]";

if comparison-result = 0 then 
    call pass(node)
else
    call fail(node,"");
    
end
